import "./styles.css";
import { Card } from "react-bootstrap";

export default function App() {
  return (
    <div className="App">
      <Card className="card">
        <Card.Title>
        <h1>
          USD Big Mac
        </h1>
        </Card.Title>
        <Card.Body>
      <h3>Start moving around the object art</h3>
      <h4>Click the AR scan to bring it to life</h4>
        </Card.Body>
      </Card>
    </div>
  );
}
